export default function RenderHomeMovies({movies}) {
// console.log(movies[2].title);
    return(
        <>
        <PageHeading text="Книги" />
  
        {movies && (
          <ul>
            {movies.map(movie => (
              <li key={movie.id}>
                <Link to={`${url}/${book.id}`}>{book.title}</Link>
              </li>
            ))}
          </ul>
        )}
      </>

    )
 
}

